"use strict";(self.webpackChunkwaku_docusaurus_template=self.webpackChunkwaku_docusaurus_template||[]).push([[75],{51022:e=>{e.exports=JSON.parse('{"pluginId":"about","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"defaultSidebar":[{"type":"link","label":"About","href":"/about/","docId":"index"},{"type":"link","label":"Description and architecture","href":"/about/architect","docId":"architect"},{"type":"link","label":"Development roadmap","href":"/about/roadmap","docId":"roadmap"},{"type":"link","label":"Core contributors","href":"/about/team","docId":"team"},{"type":"link","label":"The Waku Network","href":"/about/waku-network","docId":"waku-network"},{"type":"link","label":"Principles","href":"/about/principles","docId":"principles"}]},"docs":{"architect":{"id":"architect","title":"Description and architecture","description":"Waku is a family of protocols that enable private, censorship-resistant communications over an open-source, decentralised network. By communications, we mean the exchange of data or messages between two or more entities, whether they are users, devices, or nodes.","sidebar":"defaultSidebar"},"index":{"id":"index","title":"About","description":"Waku is a suite of generalised messaging protocols aiming to be the communication standard for the decentralised web. It enables private and secure human-to-human, machine-to-machine, and human-to-machine communication without reliance on centralised intermediaries. Messaging through Waku is possible from one-to-one to many-to-many.","sidebar":"defaultSidebar"},"principles":{"id":"principles","title":"Principles","description":"The goal of Waku is to widespread the usage of private and censorship-resistant communications.","sidebar":"defaultSidebar"},"roadmap":{"id":"roadmap","title":"Development roadmap","description":"Waku v1 is in production and was quickly adopted by the Status Mobile application. Yet, this initial version was unable to handle the scale required to support popular applications, prompting the v2 rewrite. Waku v2 has seen encouraging initial adoption beyond Status by projects such as Railgun\'s private transaction system and The Graph\'s indexer communication network Graphcast.","sidebar":"defaultSidebar"},"team":{"id":"team","title":"Core contributors","description":"Leading Waku\'s R&D efforts is Franck Royer. Franck draws on more than five years of experience within the blockchain and crypto ecosystem, and over 13 years as a software engineer and team lead with a primary focus on backend development for mission-critical applications.","sidebar":"defaultSidebar"},"waku-network":{"id":"waku-network","title":"The Waku Network","description":"The Waku Network Gen 0 is the first iteration of a public network for peer-to-peer messaging built on the Waku protocol stack. Its goal is to offer a permissionless, auto-scalable, DoS protected shared messaging layer for the decentralized web.","sidebar":"defaultSidebar"}}}')}}]);